                    src: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fm2.melon.com%2Fmusicstory%2Fdetail.htm%3FmstorySeq%3D13232&psig=AOvVaw3seW_-N3EDLynDHGqVRvJx&ust=1695042187804000&source=images&cd=vfe&opi=89978449&ved=0CBAQjRxqFwoTCOD6zK7asYEDFQAAAAAdAAAAABAY",
                },
            ],
            Comments: [
                {
                    User: {
                        nickname: "nero",
                    },
                    content: "우와 개정판이 나왔군요~",
                },
                {
                    User: {
                        nickname: "hero",
                    },
                    content: "얼른 사고싶어요~",
                },
            ],
        },
    ],
    imagePaths: [],
    postAdded: false,
};

const ADD_POST = "ADD_POST";
export const addPost = {
    type: ADD_POST,
};

const dummyPost = {
    id: 2,
    content: "더미데이터입니다.",
    User: {
        id: 1,
        nickname: "이현철",
    },
    Images: [],
    Comments: [],
};

const reducer = (state = initialValue, action) => {
    switch (action.type) {
        case ADD_POST:
            return {
                ...state,
                mainPosts: [dummyPost],
            };
        default:
            return state;
    }
};

export default reducer;
